import React from "react";
import "./Porfolio.css";

const Porfolio = () => {
  return (
    <section className="porfolio container section">
      <h1 className="section_title">✨My Newest Update✨</h1>
      <div className="on_progress">
        <h2>On Progress...</h2>
      </div>

      <div className="star-container">
        <div className="shooting-star">
          <div></div>
          <div></div>
          <div></div>
        </div>

        <div className="shooting-star2">
          <div></div>
          <div></div>
          <div></div>
        </div>
      </div>

    </section>
  );
};

export default Porfolio;
